function Logo() {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      version='1.1'
      viewBox='0 0 500 300'
      //   adjust width and height
      width='75px'
      height='75px'>
      <defs>
        <filter id='myFilter'>
          <feTurbulence type='turbulence' baseFrequency='0.1' numOctaves='5' result='turbulence'>
            <animate
              attributeName='baseFrequency'
              dur='30s'
              values='0.0001;0.02;0.0001;0.02;0.0001'
              repeatCount='indefinite'
            />
          </feTurbulence>
          <feDisplacementMap xChannelSelector='R' yChannelSelector='G' scale='25' in='SourceGraphic' in2='turbulence' />
        </filter>
      </defs>
      <image
        id='img1'
        // adjust base64 image
        xlinkHref='data:image/png;base64,'
        width='100%'
        height='100%'
        filter='url(#myFilter)'
      />
    </svg>
  )
}

export default Logo
